select product_id, 'discount', price * 0.9
from prices
where price_type = 'normal';
select product_id, 'sale', price * 0.7
from prices
where price_type = 'normal';
select product_id, 'super sale', price * 0.5
from prices
where price_type = 'normal';
select product_id, 'novelty', price * 1.4
from prices
where price_type = 'normal';

UPDATE products
  set price_id = (select prices.id from prices where product_id = products.id and price_type = 1)
where id between 1 and 20;
UPDATE products
  set price_id = (select prices.id from prices where product_id = products.id and price_type = 2)
where id between 21 and 40;
UPDATE products
  set price_id = (select prices.id from prices where product_id = products.id and price_type = 3)
where id between 41 and 60;
UPDATE products
  set price_id = (select prices.id from prices where product_id = products.id and price_type = 4)
where id between 61 and 80;
UPDATE products
  set price_id = (select prices.id from prices where product_id = products.id and price_type = 5)
where id between 81 and 100;
